import React from 'react';

const images = [
  "../img/slider/ISIF 2024-45.jpg",
  "../img/slider/ISIF 2024-74.jpg",
  "../img/slider/ISIF 2024-89.jpg",
  "../img/slider/ISIF 2024-253.jpg",
  "../img/slider/ISIF 2024-294.jpg",
  "../img/slider/ISIF 2024-45.jpg",
  "../img/background/img3.WebP"
];

const ImageSlider = () => {
    return (
        <div style={{ maxWidth: "600px", margin: "0 auto", paddingBottom: "2rem" }}>
          <Carousel fade={true} interval={2000}>
            {images.map((img, index) => (
              <Carousel.Item key={index}>
                <img
                  className="d-block w-100 rounded"
                  src={img}
                  alt={`Slide ${index + 1}`}
                  style={{ height: "250px", objectFit: "cover" }}
                />
              </Carousel.Item>
            ))}
          </Carousel>
        </div>
      );
    };

export default ImageSlider;
